import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monesters: [
        {
          name: 'Frankestein'
        },
        {
          name: 'Dracula'
        },
        {
          name: 'Zombie'
        }
      ]
    };
  }

render() {
  return (
    <div className="App">
      {
        this.state.monesters.map(monesters=> (<h1>{monesters.name}</h1>))
      }
    </div>
  );
}

}



export default App;
